(35, 'E-Book - Financial and Managerial Accounting (Ole Miss) ACCY  201 and 202', 'ISBN: 978-0-07-8025660-0\nE-Book for Accounting I and II \nOnline Access Code on Back. McGraw Hill Connect-Plus (BRAND NEW) ', 50, 0, 2, 'public/uploads/itempics/44_1423189872.jpg', 44, 1, '2015-03-18 19:03:16', NULL),
(36, 'Ipad 2', 'Ipad 2 - GREAT CONDITION! Accessories included!!', 350, 0, 7, 'public/uploads/itempics/44_1425429001.jpg', 44, 1, '2015-03-03 18:03:08', NULL),
(37, 'Financial Advice', 'I understand spring break is coming up so hopefully following these tips can help you to be prepared financially. Being in college you are bound to get frustrated if you don''t have financial support from home, and if you are unfortunate to find a job.\n\n1. Create a budget\nStick to a simple budget for basic necessities. That designer purse or shoes are not as important as food and textbooks. If you get a refund, and it is from a loan, you have to pay it back when you graduate. The best thing to do is SAVE! Even if it is just $20 a week, it is always best to be prepared for an emergency. Having a budget keeps you on target and helps prevent you from having any overdraft fees with your bank.\n2. Be careful with credit cards \nCredit cards can be great if you are responsible, but can set you up for financial disaster if you have risky spending habits. One important thing to note is that If you are going to get a credit card do not wait to pay your bill. Make sure you pay the full balances of your bill on or before the date it is due. By paying off your balances this will increase your credit score and allow you to increase your credit limit. Look into getting credit cards designed for students such as Discover and Capital One. Always remember to watch your spending as well, never buy something with the card that you could not with cash.\n3. Coupons are your best friend!\nBeing a student in college it is tempting to just buy items on impulse. Rather than eating out all the time, first check to see if the stores/restaurants have student discounts. Especially in college towns, showing your college id can save you extra bucks. Also check your mailbox for coupons, a lot are online now as well. \n4. Buy textbooks online after the first day of class\nAfter the first day of class you will know exactly what books you will need, and if the material will be online. Try renting the textbook if you aren''t able to find a deal on College Drifters!\n5. Buy what you need!\nYou are in college there is no need to want to have to buy really expensive furniture. College is your home for a couple of years, so have fun, and don''t stress about the need to buy everything. I mean is an aquarium really needed? Utilize having a roommate by splitting majority of costs and make sure that you don''t regret any purchases later.\nLastly, but not least, this spring break when traveling be careful where you have your money to keep identity and credit cards/money from being stolen. \n\nBe safe Drifters!  \n\nHave a happy spring break!\n\n', 0, 0, 12, 'public/uploads/itempics/_1425839683.jpg', NULL, 1, '2015-03-08 13:03:48', NULL),
(38, 'Apartment Availability for Game Days (Oxford, MS)', '<p>Looking for a nice place Apartment availabe for rent on Game Day Weekends at Ole Miss. One Bedroom/One Bath apartment at the <a href="https://www.facebook.com/TheLinksAtOxford">Links Golf Course Apartments</a>. Reasonable rates. Call 662-610-3047 or email&nbsp;<a href="mailto:dillon5594@gmail.com" target="_blank">dillon5594@gmail.com</a>&nbsp;for more details.&nbsp;</p>\n', 0, 0, 1, 'public/uploads/itempics/44_1441241489.jpg', 44, 1, '2015-09-02 19:09:43', NULL),
